import './App.scss';
import Login from './component/Login/Login';
import Nav from './component/Navigation/Nav';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Register from './component/Register/Register';

function App() {
  return (
    <Router>
    <div className='app-container'>
      {/* <Nav/> */}
      <Switch>
          <Route path="/new">
          new
          </Route>
          <Route path="/about">
            about
          </Route>
          <Route path="/contact">
            contact
          </Route>
          <Route path="/login">
           <Login/>
          </Route>
          <Route path="/register">
          <Register/>
          </Route>
          <Route path="/" exact>
           HOme
          </Route>
          <Route path='*'>
            Not Found
          </Route>
        </Switch>
    </div>
    </Router>
  )
}

export default App;
